import Bmovies from "./Bmovies";
import Navigation from "./navigation";
const Bollywood = () => {
  return (
    <>
      <Navigation />
      <Bmovies j={870} k={900} />
      <Bmovies j={840} k={870} />
      <Bmovies j={810} k={840} />
      <Bmovies j={720} k={750} />
      <Bmovies j={150} k={200} />
      <Bmovies j={121} k={149} />
      <Bmovies j={70} k={109} />
    </>
  );
};

export default Bollywood;
